import React from 'react';
import { useNavigate } from 'react-router-dom';
import FileCloak from '../FileCloak.webp';
import './SignUp.css';

function SignUp() {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <>
      <div className="signup-container" id="registerForm">
        <div className="logo-container">
          <img src={FileCloak} className="HomePage-logo" alt="FileCloak" />
        </div>
        <form className="signup-form" onSubmit={handleSubmit}>
          <div className="input-group">
            <input type="text" id="email" name="email" placeholder="Email" required />
            <i className="icon email-icon"></i> 
          </div>
          <div className="input-group">
            <input type="password" id="password" name="password" placeholder="Password" required />
            <i className="icon password-icon"></i> 
          </div>
          <div className="input-group">
            <input type="password" id="repeatPassword" name="repeatPassword" placeholder="Repeat Password" required />
            <i className="icon password-icon"></i> 
          </div>
          <button type="submit" className="button">SIGNUP</button>
          <button
            className="login-btn"
            onClick={(event) => {
              event.preventDefault();
              handleNavigation('/login');
            }}
          >
            Login
          </button>
        </form>
      </div>
    </>
  );
}

export default SignUp;
